        "                      'tr\\.im|link\\.zip\\.net',\n",
        "                      url)\n",
        "    if match:\n",
        "        return 1\n",
        "    else:\n",
        "        return 0\n",
        "\n",
        "data['short_url'] = data['url'].apply(lambda i: shortening_service(i))\n",
        "\n",
        "def count_https(url):\n",
        "    return url.count('https')\n",
        "\n",
        "data['count-https'] = data['url'].apply(lambda i : count_https(i))\n",
